INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(187442, 'koKR', '', '네 죄는 수도 없이 많지만, 그중에서도 무고한 자들을 야수에게 던져놓는 것만큼 잔혹한 건 없구나.', 37474),
(38124, 'koKR', '어둠을 받아들여라... 영원의 어둠을.', '어둠을 받아들여라... 영원의 어둠을.', 37474),
(180366, 'koKR', '', '승천의 보루에 오신 것을 기쁜 마음으로 환영합니다. 한데... 당신은 제가 봐온 다른 영혼들과는 다르군요. 걱정 마십시오.', 37474),
(187280, 'koKR', '눈의 의회의 절멸로 우리의 비밀은 지켜졌다. 이제 우리 일을 방해할 자는 그 누구도 남지 않았단 뜻이지.', '', 37474),
(185904, 'koKR', '질투라고? 당치도 않군. 내가 녀석보다 모든 면에서 우월했거늘!', '', 37474),
(182733, 'koKR', '지식의 표식입니다. 무지와 두려움에 맞서기 위한 봉홧불이지요.', '', 37474),
(180367, 'koKR', '', '당신은 한 명의 키리안이 될 겁니다! 우리의 신성한 사명은 필멸 세계의 영혼을 심판관님 앞으로 인도하는 것입니다.', 37474),
(194383, 'koKR', '', '이거 재미있겠는데요.', 37474),
(182626, 'koKR', '', '준비를 마쳤으면 불길에 다가가 감시자의 지시를 따르도록 하세요.', 37474),
(202313, 'koKR', '', '제발 허락해 주십시오, 놈들을 꿰뚫고, 베고, 가르겠습니다! 뼈와 살을 갈기갈기 도려내--', 37474),
(202311, 'koKR', '흐음, 그것도 한 방법이로다... 저 오만불손하고 편협한 생물들의 뼈를 발라내어 우리의 승천으로 이어지는 길을 수놓을 수도 있겠지. 이를 어쩐다, 참으로 난제로고...', '', 37474),
(202310, 'koKR', '', '더 좋은 생각이 있습니다, 주인님! 제가 놈들을 발라버리겠나이다!', 37474),
(202312, 'koKR', '', '간절히 부탁드립니다, 주인님! 살아있는 육신을 베어본 게 언제인지 기억도 안 납니다!', 37474),
(202315, 'koKR', '이 내가 친히 손님들의 속죄를 돕겠다. 저들이 죄를 뉘우치거든 육신을 베고 절규하는 영혼을 나락에 던지는 것을 윤허하마!', '', 37474),
(205464, 'koKR', '', '당신 세계의 생명체들이 그토록 강력한 이유를 알겠습니다. 과연 불타는 군단을 몰아낼 만합니다. 몽환숲을 대표해 그 힘을 빌려준 당신에게 감사를 전합니다.', 37474),
(191962, 'koKR', '<조각상 받침대에 글귀가 새겨져 있습니다.>\n\n존중이란 힘의 시련을 통해 얻어내는 것이다. 두각을 드러내는 자에겐 경례를 보내 마땅하노라.', '', 37474),
(191966, 'koKR', '<조각상 받침대에 글귀가 새겨져 있습니다.>\n\n때로는 어둠 속에 진실이 숨어 있는 법. 실력 있는 이들은 적들의 눈을 피해 슬금슬금 달아날 것이다.', '', 37474),
(180775, 'koKR', '수풀사령관님께... 알려야 하는데...', '수풀사령관님께... 알려야 하는데...', 37474),
(193577, 'koKR', '', '이걸 잠시 들고 있어 봐라.', 37474),
(186290, 'koKR', '우아하면서도 강력하오. 한 세계를 수호할 왕관이오.', '', 37474),
(193598, 'koKR', '', '자, 널 어디로 날려볼까?', 37474),
(193582, 'koKR', '', '이걸 한번 맛볼 테냐?', 37474),
(203409, 'koKR', '토르가스트의 업화에서... 무기가 벼려졌다. 한의 검이... 탄생한 것이다.', '', 37474),
(196707, 'koKR', '준비되면 발사하시오!', '', 37474),
(199409, 'koKR', '제 령이 필요하다고요? 고대 티르넨은 뭘 하는데요?', '', 37474),
(199444, 'koKR', '됐습니다. 그럼 끝을 내지요!', '', 37474),
(198956, 'koKR', '이럴 시간이 없습니다, $c님. 백작님께서 기다리고 계십니다.', '이럴 시간이 없습니다, $c님. 백작님께서 기다리고 계십니다.', 37474),
(206412, 'koKR', '', '어쩌다가 말드락서스에 오게 되었지, $p?\n\n궁정 연회에 버섯이 더 필요한가, 아니면 성벽을 지킬 말드락서스 병사가 더 필요한가?\n\n<미소 짓는 남작 바쉬>\n\n사실 예상한 것보다 잿불 궁정이 훨씬 즐겁긴 하구나.\n\n레나탈 왕자가 중앙 무대에서 사회자를 맡았지만, 네게 눈길이 더 가더구나.\n\n넌 무대 뒤에서 무대를 움직이는 자다. 내가 여왕의 궁정 시절에 그랬듯이.\n\n<당신을 응시하는 남작 바쉬>\n\n분명 네가 하는 일은 쉽지 않은 일이다.', 37474),
(202361, 'koKR', '키리안이여! 영겁의 기록 보관소에 온 것을 환영하노라. 이곳으로 흘러드는 령이 너의 기량을 한 단계 위로 끌어올려 줄 것이다.\n\n나의 강화를 받으면 다음과 같은 능력을 얻는다.\n\n|TInterface\\ICONS\\Achievement_Raid_Thunder_King.blp:20|t|cFFFF0000|Hspell:335576|h[승천자의 등불]|h|r: 생명력이 90% 이상일 때 공격 주문 및 능력 사용 시 일정 확률로 대상에게 수집의 표적을 시전해 일정 시간에 걸쳐 피해를 입힙니다. 이 시간 동안 적을 처치하면 그 령을 수집하여 짧은 시간 동안 피해를 흡수하는 보호막을 얻습니다.', '키리안이여! 영겁의 기록 보관소에 온 것을 환영하노라. 이곳으로 흘러드는 령이 너의 기량을 한 단계 위로 끌어올려 줄 것이다.\n\n나의 강화를 받으면 다음과 같은 능력을 얻는다.\n\n|TInterface\\ICONS\\Achievement_Raid_Thunder_King.blp:20|t|cFFFF0000|Hspell:335576|h[승천자의 등불]|h|r: 생명력이 90% 이상일 때 공격 주문 및 능력 사용 시 일정 확률로 대상에게 수집의 표적을 시전해 일정 시간에 걸쳐 피해를 입힙니다. 이 시간 동안 적을 처치하면 그 령을 수집하여 짧은 시간 동안 피해를 흡수하는 보호막을 얻습니다.', 37474),
(199451, 'koKR', '', '흑.... 예전에 한 번 드림위버랑...', 37474),
(183994, 'koKR', '', '조금 왼쪽으로!', 37474),
(183995, 'koKR', '', '왼쪽! 오른쪽! 거기 말고 다른 오른쪽!', 37474),
(183993, 'koKR', '꼭대기에 닿아?', '', 37474),
(204708, 'koKR', '죽은 블랑쉬가 온순하게 발굽을 들어 보살핌을 받습니다. 숨을 헐떡이며 콧바람을 힘겹게 내뿜는 것이 무척이나 목이 말라 보입니다.', '', 37474),
(204686, 'koKR', '당신이 손질용 솔로 피부 자극물을 쓸어내자 죽은 블랑쉬가 몸을 부르르 떨며 당신에게 코를 비벼댑니다. 블랑쉬가 몸을 가누며 발을 구르자 극심하게 망가진 발굽이 당신의 눈길을 사로잡습니다.', '', 37474),
(204663, 'koKR', '죽은 블랑쉬가 열성적으로 귀리를 받아먹습니다. 블랑쉬의 털은 덥수룩하지만, 피부는 따가운 진드기, 날카로운 가시, 냄새 나는 진흙으로 자극물이 잔뜩 붙어 있는 상태입니다.', '', 37474),
(204710, 'koKR', '안장 담요를 놓아도 죽은 블랑쉬는 한 치의 미동도 없이 얌전히 서 있습니다. 떨림이 느려지다 완전히 멈추자 당신의 가방에서 간식을 찾기 시작합니다.', '', 37474),
(204668, 'koKR', '죽은 블랑쉬가 당신을 들이받지 않도록 갑작스럽게 멈추어 섭니다.', '', 37474),
(204903, 'koKR', '죽은 블랑쉬의 눈이 광포하게 번뜩입니다. 형상은 병들어 있으며, 수척하기까지 합니다. 굶주린 건 명백하니 배를 채워줘야 합니다.', '', 37474),
(121956, 'koKR', '나, 마티아스 쇼는 이 자리에서 탈주 요원 앰버 켈넌을 추적할 권한을 붉은 칼날단에 허가한다.', '', 37474),
(204709, 'koKR', '죽은 블랑쉬가 물동이를 완전히 들이켜 버리곤 당신에게 머리를 들이밉니다. 갈증은 채웠지만 이젠 주체할 수 없이 덜덜 떨어댑니다.', '', 37474),
(54130, 'koKR', '', '렐이... 많이 다쳤어요.$b$b<주먹으로 땅을 내리치는 켈넌 요원>$b$b죽어가고 있다고요, $n 님! 그런데도 우리가 할 수 있는 게 아무것도 없어요!', 37474),
(204749, 'koKR', '죽은 블랑쉬가 사과 냄새를 맡더니 콧김을 뿜어대더니, 열성적으로 먹어 치워버립니다. 그리곤 만족감이 섞인 한숨을 내쉬더니 당신의 어깨에 머리를 치댑니다.', '', 37474),
(121283, 'koKR', '앰버 켈넌은 우리 동료였어... 왜 제거했어야 하는지 모르겠어.', '', 37474),
(197546, 'koKR', '', '그만! 몸을 뒤트는 꼴이 역겹기 그지없구나.', 37474),
(207303, 'koKR', '당신이 우리를 도와 숲을 지켜주셔서 정말 다행입니다, 사냥꾼님.', '당신이 우리를 도와 숲을 지켜주셔서 정말 다행입니다, 사냥꾼님.', 37474),
(189107, 'koKR', '주문술사가 더 필요한 상황이긴 한데, 그렇다고 요구 조건을 낮출 수야 없지.', '', 37474);
INSERT INTO `faction_locale` (`ID`, `locale`, `Name_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(2463, 'koKR', '마라스미우스', '가늠할 수 없을 정도로 오래된 몽환숲의 거주민으로, 버섯을 닮은 마라스미우스는 이 세계의 생태계를 구성하는 핵심 요소입니다. 적극적으로 도우려 한 당신의 모습에 심장을 닮은 그의 신체 일부가 조금 누그러졌고, 그 덕분에 해야 할 일이 꽤 많아졌습니다.', 37474),
(2410, 'koKR', '죽지 않는 군대', '아득히 먼 옛날, 시초자는 궁극의 군대를 양성하고자 말드락서스의 다섯 의회를 세웠습니다. 이 죽지 않는 무적의 군대는 힘, 지혜, 기지를 무기로 어둠땅을 모든 위협으로부터 수호하겠노라 맹세했습니다.', 37474),
(2465, 'koKR', '야생 사냥단', '절체절명의 시기에 부름을 받아 겨울 여왕을 섬기는 야생 사냥단은 몽환숲에서 내로라하는 최고의 사냥꾼이 모인 집단입니다. 야생 사냥단은 가뭄과 위험에 맞서 숲을 사수할 것입니다.', 37474),
(2462, 'koKR', '바느질 대가', '바느질 대가는 육신과 뼈, 령을 하나로 융합하여 피조물을 만들어 내는 능력으로 널리 알려져 있으며, 이 독보적인 능력 덕분에 말드락서스에서 아주 막강한 아군이 될 수 있습니다. 배신한 피조물의 의회로부터 갈라져 나온 후, 이들은 도살자 구역에 자리를 잡았습니다.', 37474),
(2464, 'koKR', '밤의 궁정', '겨울 여왕을 비롯한 야생 사냥단의 이목이 령 가뭄과 드러스트의 침략에 쏠린 탓에, 야생씨앗과 숲을 보호하는 일은 밤의 궁정에 속한 수풀사령관들이 맡게 되었습니다.', 37474);
