(1309, 'koKR', '파들거리는 령진드기', '|cFFFFD200모험:|r 어둠땅|n', '이 대단히 날렵한 벌레는 탈것으로 사용하기에 손색이 없습니다. 물론 기수의 령을 모조리 흡수하지 않도록 훈련을 받았다는 전제하에 말이죠.', 37474),
(1420, 'koKR', '암영 낫뿔벌레', '|cFFFFD200상인: |r스핀들노즈|n|cFFFFD200지역: |r몽환숲', '암영 게걸충은 모든 게걸충을 통틀어 가장 온순합니다. 그러면서도 뿔과 아래턱은 가장 크게 성장하죠. 사실 다른 생명체가 심기를 거스를 일이 없는 것도 온순한 성격에 한몫한다고 볼 수 있습니다.', 37474),
(1414, 'koKR', '죄악질주마 블랑쉬', '|cFFFFD200NPC:|r 죽은 블랑쉬 |n|cFFFFD200지역:|r 레벤드레스|n |n', '생전의 블랑쉬는 빼어난 기질과 식성을 자랑하는 사랑스럽고 얌전한 준마로서의 면모를 보였습니다. 한데 남들 모르게 무슨 죄악을 저질렀기에 레벤드레스의 저주받은 영혼들의 대열에 합류한 걸까요?', 37474),
(1291, 'koKR', '운수대통의 윈', '|cFFFFD200게임 내 상점|r|n', '판다렌 사이에서는 이 소를 어루만지기만 해도 풍요가 찾아온다는 믿음이 퍼져있습니다. 붙잡는 것 자체가 고난이라 그렇죠.', 37474),
(1424, 'koKR', '눈폭풍', '|cFFFFD200블리자드 30주년|r ', '아제로스의 태양 아래 모험가가 찾는 빙설의 땅에서 온 친구입니다.', 37474);
