(2047, 'koKR', '말드락서스 - 이야기 최종', '', 37474),
(2092, 'koKR', '돌의 선혈', '데나트리우스의 돌 군단 장군이 차분히 기다리며, 반란군을 완전히 궤멸할 덫을 준비하고 있습니다.', 37474),
(2090, 'koKR', '착취의 금고', '아물지 않은 상처에서 피가 흐르듯, 나스리아 성채의 금고에서 령이 새어 나오고 있습니다. 레벤드레스가 쇠진하기 전에 누출을 막아야 합니다.', 37474),
(2096, 'koKR', '교만과의 대면', '데나트리우스가 탑에서 영웅들이 도착하기만을 기다리고 있습니다. 레벤드레스의 운명을 놓고 결착을 지을 순간이 다가왔습니다.', 37474),
(2091, 'koKR', '부유의 성물', '귀족들이 승리에 심취해 연회를 즐기는 지금, 영웅들이 난입해 그들을 권력에서 끌어내려야 합니다.', 37474),
(2070, 'koKR', '죽음의 상흔', '', 37474),
(2074, 'koKR', '속죄의 전당', '', 37474),
(2069, 'koKR', '역병 몰락지', '', 37474),
(2072, 'koKR', '티르너 사이드의 안개', '', 37474),
(2089, 'koKR', '승천의 길 (연습)', '승천의 길에서 영혼결속자가 역량을 입증할 수 있도록 도와야 합니다.', 37474),
(2084, 'koKR', '승천의 길', '승천의 길에서 영혼결속자가 역량을 입증할 수 있도록 도와야 합니다.', 37474),
