(568, 'koKR', '$p에게,\n\n지난 편지에 네가 적은 처치 수의 정확성에 관해선 반론하지 않겠다.\n\n하지만 너무 많은 수라 조금 의심스럽긴 하군. 물론 네가 나락 방랑자라 그런 거겠지...\n\n그래도 너와 겨루는 건 즐거우니, 따라갈 수 있도록 노력하겠다.\n\n지난 편지를 받은 후 적을 138마리 처치했--\n\n<종이 바깥으로 이어지는 사냥대장 코레인의 글씨>\n\n152마리로 정정한다! 마지막 무리 중 일부는 진드기였지만, 네가 이렇게나 앞서가고 있으니 어쩔 수 없지!\n\n어디 뛰어넘어 보라고.\n사냥대장 코레인', 37474);
INSERT INTO `chr_classes_locale` (`ID`, `locale`, `Name_lang`, `NameMale_lang`, `NameFemale_lang`, `Description_lang`, `RoleInfoString_lang`, `DisabledString_lang`, `HyphenatedNameMale_lang`, `HyphenatedNameFemale_lang`, `VerifiedBuild`) VALUES
(3, 'koKR', '사냥꾼', '사냥꾼', '사냥꾼', '사냥꾼은 야생의 세계에서 가장 편안함을 느끼고 야수와 밀접한 관계를 맺는다. 사냥꾼은 무기와 야수를 함께 활용하여 적을 공격한다.', '역할: |cffffffff원거리 또는 근접 공격|r', '이 직업으로 플레이하려면 다른 종족을 선택해야 합니다.', '사냥꾼', '사냥꾼', 37474),
(1, 'koKR', '전사', '전사', '전사', '전사는 판금 갑옷 투사로서 완벽한 무장 전투를 추구한다. 전투 시 차오르는 분노를 모아 특수 공격 기술에 사용한다.', '역할: |cffffffff방어, 근접 공격|r', '이 직업으로 플레이하려면 다른 종족을 선택해야 합니다.', '전사', '전사', 37474),
(11, 'koKR', '드루이드', '드루이드', '드루이드', '드루이드는 동식물의 세계에 대한 친화력을 바탕으로 변신술을 구사한다. 드루이드는 치유 또는 원거리 주문 공격 전문화를 선택하거나, 표범 또는 곰으로 변신하여 근접 거리에서 싸우는 전문화를 선택할 수도 있다.', '역할: |cffffffff방어, 치유, 원거리 공격, 근접 공격|r', '이 직업으로 플레이하려면 다른 종족을 선택해야 합니다.', '드루이드', '드루이드', 37474),
(5, 'koKR', '사제', '사제', '사제', '사제는 다양한 기술을 지닌 균형 잡힌 치유사이지만, 치유를 포기하고 암흑 마법 공격에 주력하기도 한다.', '역할: |cffffffff치유, 원거리 공격|r', '이 직업으로 플레이하려면 다른 종족을 선택해야 합니다.', '사제', '사제', 37474),
(8, 'koKR', '마법사', '마법사', '마법사', '마법사는 아제로스의 대표적인 마법 사용자들로, 심오한 학습과 연구를 통해 기술을 연마한다. 마법사의 갑옷은 뚫기 쉽지만, 강력한 공격 및 방어 주문으로 이를 보완한다.', '역할: |cffffffff원거리 공격|r', '이 직업으로 플레이하려면 다른 종족을 선택해야 합니다.', '마법사', '마법사', 37474),
(7, 'koKR', '주술사', '주술사', '주술사', '주술사는 정기로 무기 공격력과 주문을 강화한다. 전투 중 적을 무력화하거나, 아군을 치유하거나, 적에게 피해를 입히는 토템을 소환한다.', '역할: |cffffffff치유, 원거리 공격, 근접 공격|r', '이 직업으로 플레이하려면 다른 종족을 선택해야 합니다.', '주술사', '주술사', 37474),
(12, 'koKR', '악마사냥꾼', '악마사냥꾼', '악마사냥꾼', '악마사냥꾼은 영웅 직업으로, 높은 레벨부터 모험을 시작한다. 악마사냥꾼은 어둠의 추방자로, 금지된 악마의 마법을 사용하여 적을 추적하고 처치한다.', '역할: |cffffffff방어, 근접 공격|r', '군단 확장팩 및 70 레벨 이상의 캐릭터 필요', '악마사냥꾼', '악마사냥꾼', 37474),
(9, 'koKR', '흑마법사', '흑마법사', '흑마법사', '흑마법사는 화염 마법 또는 암흑 마법으로 적을 공격하고, 저주를 내리거나 생명력을 흡수한다. 악마를 소환하여 하수인으로 부리기도 한다.', '역할: |cffffffff원거리 공격|r', '이 직업으로 플레이하려면 다른 종족을 선택해야 합니다.', '흑마법사', '흑마법사', 37474),
(4, 'koKR', '도적', '도적', '도적', '도적은 주로 암살자나 정찰병으로 활약하지만, 대다수의 도적은 한 마리 외로운 늑대와도 같다. 이들은 적진 한가운데 숨거나 적의 배후에서 공격을 시도함으로써 순식간에 적의 목숨을 끊어놓는다.', '역할: |cffffffff근접 공격|r', '이 직업으로 플레이하려면 다른 종족을 선택해야 합니다.', '도적', '도적', 37474);
